    <div className="service-page">
      <h1 className="service-title">Venue Finding</h1>
      <div className="image-row">
        <div className="image-box">Image</div>
        <div className="image-box">Image</div>
      </div>
      <Link to="/contact" className="book-button">Book Consultant</Link>
      <p className="service-text">
        Venue finding in event ticketing is the process of identifying and selecting the most suitable
        location for hosting an event. It involves evaluating factors such as capacity, location accessibility,
        facilities, cost, and technical requirements. Organizers must ensure the venue aligns with the eventâ€™s
        purpose, target audience, and expected turnout. The process may also involve checking availability
        for specific dates and negotiating rental terms. In ticketing, venue details are critical because
        seating layouts, sections, and amenities directly affect ticket pricing and sales strategy. Good
        venue selection can enhance the attendee experience and increase ticket demand.
      </p>
    </div>
  );
}
